import React from 'react';
import ReactDOM  from 'react-dom'; 
import "./index.css";

const name ="vaishnavi shetty";
const img1="https://picsum.photos/200/300";
const img2="https://picsum.photos/200";
const img3="https://picsum.photos/200";
const links="https://picsum.photos/";

ReactDOM.render(
  <>
  <h1 class="heading">Hello! My name is {name}</h1>
  <img src={img1} alt="timepass"/>
  <img src={img2} alt="hey"/>
  <a href={links} target="_blank">
   < img src={img3} alt="heyyy"/>
  </a>
  </>
  ,document.getElementById('root1')
);
